import './App.css';
import { Routes, Route } from 'react-router-dom';
import About from './containers/about';
import Home from './containers/home';
import Resume from './containers/resume';
import Portfolio from './containers/portfolio';
import Skills from './containers/skills';
import Navbar from './components/navBar';
import Particles from "react-tsparticles";
import { loadSlim } from "tsparticles"; // ✅ Using loadSlim instead of loadFull
import particlesConfig from './utils/particles';

function App() {
  const handleInit = async (engine) => {
    console.log("Particles Engine Loaded", engine);
    await loadSlim(engine); // ✅ Using loadSlim for better compatibility
  };

  return (
    <div className="App">
      {/* Background Particles */}
      <Particles id="particles" init={handleInit} options={particlesConfig} />

      {/* Navbar */}
      <Navbar />

      {/* Page Routes */}
      <Routes>
        <Route index path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/resume" element={<Resume />} />
        <Route path="/portfolio" element={<Portfolio />} />
        <Route path="/skills" element={<Skills />} />
      </Routes>
    </div>
  );
}

export default App;
